-- *******************************************************************************
-- * Script que crea y carga datos en las tablas restaurantes, salud y shoppings *
-- *******************************************************************************

-- ************************
-- ** Tabla restaurantes **
-- ************************

CREATE TABLE public.restaurantes
(
    id integer,
    geom geometry,
    nombre character varying(254),
	direccion character varying(254),
    barrio character varying(254),
	comuna character varying(254),
	PRIMARY KEY (id)
)
WITH (
    OIDS = FALSE
)
TABLESPACE pg_default;

ALTER TABLE public.restaurantes
    OWNER to postgres;
	
	


-- *****************
-- ** Tabla salud **
-- *****************

CREATE TABLE public.salud
(
    id integer,
    geom geometry,
    nombre character varying(254),
	PRIMARY KEY (id)
)
WITH (
    OIDS = FALSE
)
TABLESPACE pg_default;

ALTER TABLE public.salud
    OWNER to postgres;
	



-- *********************
-- ** Tabla shoppings **
-- *********************

CREATE TABLE public.shoppings
(
    id integer,
    geom geometry,
    nombre character varying(254),
    comuna character varying(254),
    barrio character varying(254),
	PRIMARY KEY (id)
)
WITH (
    OIDS = FALSE
)
TABLESPACE pg_default;

ALTER TABLE public.shoppings
    OWNER to postgres;
	
	
